import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { motion } from 'framer-motion';
import { 
  Container, 
  Box, 
  Typography, 
  Button, 
  Alert,
  Paper,
  Breadcrumbs,
  Link,
  Chip
} from '@mui/material';
import { 
  ArrowBack, 
  Home,
  NavigateNext,
  PlayArrow,
  School
} from '@mui/icons-material';

// Import challenge components
import Challenge1 from '../components/challenges/Challenge1';
import ChallengeRunner from '../components/challenges/ChallengeRunner';
import LoadingSpinner from '../components/common/LoadingSpinner';
import { challengeDetailsData } from '../utils/ChallengeData';
import { fetchChallenge, setCurrentChallenge } from '../store/challengeSlice';
import { connectRobot, fetchRobotStatus } from '../store/robotSlice';
import { getDifficultyColor } from '../utils/helpers';

const IndividualChallengePage = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const dispatch = useDispatch();

  const { currentChallenge, loading, error } = useSelector(state => state.challenges);
  const { connected, connectionStatus } = useSelector(state => state.robot);
  const { user } = useSelector(state => state.auth);

  const [challengeStarted, setChallengeStarted] = useState(false);

  useEffect(() => {
    if (id) {
      dispatch(fetchChallenge(id));
      dispatch(setCurrentChallenge(id));

      // Try to get robot status
      dispatch(fetchRobotStatus());
    }
  }, [id, dispatch]);

  const handleComplete = (result) => {
    console.log('Challenge completed:', result);
    setChallengeStarted(false);

    // Navigate back with success message
    navigate('/dashboard', { 
      state: { 
        message: result.success ? 'Challenge completed successfully!' : 'Challenge attempt recorded.',
        type: result.success ? 'success' : 'info'
      } 
    });
  };

  const handleStartChallenge = () => {
    setChallengeStarted(true);

    // Connect to robot if not already connected
    if (!connected && connectionStatus !== 'connecting') {
      dispatch(connectRobot());
    }
  };

  // Render specific challenge component based on ID
  const renderChallengeComponent = () => {
    switch (id) {
      case 'C1':
        return (
          <Challenge1 
            challenge={currentChallenge} 
            onComplete={handleComplete} 
          />
        );
      case 'C2':
        // Add Challenge2 component when ready
        return (
          <ChallengeRunner 
            challenge={currentChallenge} 
            onComplete={handleComplete} 
          />
        );
      case 'C3':
      case 'C4':
      case 'C5':
        // Use ChallengeRunner for other challenges
        return (
          <ChallengeRunner 
            challenge={currentChallenge} 
            onComplete={handleComplete} 
          />
        );
      default:
        return (
          <ChallengeRunner 
            challenge={currentChallenge} 
            onComplete={handleComplete} 
          />
        );
    }
  };

  if (loading) {
    return (
      <Box className="flex-center" style={{ minHeight: '60vh' }}>
        <LoadingSpinner message="Loading challenge..." />
      </Box>
    );
  }

  if (error) {
    return (
      <Container maxWidth="lg">
        <Box sx={{ py: 4 }}>
          <Alert severity="error" sx={{ mb: 3 }}>
            {error}
          </Alert>
          <Button 
            variant="outlined" 
            startIcon={<ArrowBack />}
            onClick={() => navigate('/dashboard')}
          >
            Back to Dashboard
          </Button>
        </Box>
      </Container>
    );
  }

  if (!currentChallenge) {
    return (
      <Container maxWidth="lg">
        <Box sx={{ py: 4 }}>
          <Alert severity="warning" sx={{ mb: 3 }}>
            Challenge not found.
          </Alert>
          <Button 
            variant="outlined" 
            startIcon={<ArrowBack />}
            onClick={() => navigate('/dashboard')}
          >
            Back to Dashboard
          </Button>
        </Box>
      </Container>
    );
  }

  // For C1, render the custom Challenge1 component directly
  if (id === 'C1') {
    return renderChallengeComponent();
  }

  // For other challenges, use the existing layout with ChallengeRunner
  return (
    <Container maxWidth="xl">
      <Box sx={{ py: 3 }}>
        {/* Breadcrumbs */}
        <Breadcrumbs 
          separator={<NavigateNext fontSize="small" />} 
          sx={{ mb: 3 }}
          aria-label="breadcrumb"
        >
          <Link 
            color="inherit" 
            href="/" 
            onClick={(e) => { e.preventDefault(); navigate('/'); }}
            sx={{ display: 'flex', alignItems: 'center', textDecoration: 'none' }}
          >
            <Home sx={{ mr: 0.5 }} fontSize="inherit" />
            Home
          </Link>
          <Link
            color="inherit"
            href="/dashboard"
            onClick={(e) => { e.preventDefault(); navigate('/dashboard'); }}
            sx={{ textDecoration: 'none' }}
          >
            Dashboard
          </Link>
          <Typography color="text.primary">
            Challenge {currentChallenge.id}
          </Typography>
        </Breadcrumbs>

        {/* Navigation Button */}
        <Button
          startIcon={<ArrowBack />}
          onClick={() => navigate('/dashboard')}
          sx={{ mb: 3 }}
          variant="outlined"
        >
          Back to Dashboard
        </Button>

        {/* Challenge Header */}
        <Paper sx={{ p: 4, mb: 4, bgcolor: 'background.paper' }}>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', mb: 3 }}>
            <Box>
              <Typography variant="h4" component="h1" gutterBottom>
                Challenge {currentChallenge.id}: {currentChallenge.title}
              </Typography>
              <Typography variant="h6" color="text.secondary" sx={{ mb: 2 }}>
                {currentChallenge.description}
              </Typography>

              <Box sx={{ display: 'flex', gap: 2, flexWrap: 'wrap' }}>
                <Chip
                  label={currentChallenge.difficulty || 'Beginner'}
                  sx={{
                    backgroundColor: getDifficultyColor(currentChallenge.difficulty),
                    color: 'white',
                    fontWeight: 'bold'
                  }}
                />

                {currentChallenge.estimated_time && (
                  <Chip
                    label={`~${currentChallenge.estimated_time} min`}
                    variant="outlined"
                    color="primary"
                  />
                )}

                {currentChallenge.is_completed && (
                  <Chip
                    label={`Best Score: ${currentChallenge.best_score || 0}%`}
                    color="success"
                    variant="outlined"
                  />
                )}

                <Chip
                  label={currentChallenge.is_completed ? 'Completed' : currentChallenge.is_unlocked ? 'Available' : 'Locked'}
                  color={currentChallenge.is_completed ? 'success' : currentChallenge.is_unlocked ? 'primary' : 'default'}
                />
              </Box>
            </Box>

            {!challengeStarted && currentChallenge.is_unlocked && (
              <Button
                variant="contained"
                size="large"
                startIcon={<PlayArrow />}
                onClick={handleStartChallenge}
                sx={{ minWidth: 160 }}
              >
                Start Challenge
              </Button>
            )}
          </Box>

          {/* Challenge Instructions */}
          {currentChallenge.instructions && (
            <Box sx={{ mt: 3 }}>
              <Typography variant="h6" gutterBottom>
                ðŸ“‹ Instructions
              </Typography>
              <Typography variant="body1" color="text.secondary">
                {currentChallenge.instructions}
              </Typography>
            </Box>
          )}

          {/* Learning Objectives */}
          {currentChallenge.learning_objectives && (
            <Box sx={{ mt: 3 }}>
              <Typography variant="h6" gutterBottom>
                ðŸŽ¯ Learning Objectives
              </Typography>
              <Box component="ul" sx={{ pl: 2 }}>
                {currentChallenge.learning_objectives.map((objective, index) => (
                  <Typography component="li" key={index} variant="body2" color="text.secondary">
                    {objective}
                  </Typography>
                ))}
              </Box>
            </Box>
          )}
        </Paper>

        {/* Connection Status */}
        {!connected && challengeStarted && (
          <Alert severity="info" sx={{ mb: 3 }}>
            {connectionStatus === 'connecting' 
              ? 'Connecting to robot hardware...' 
              : 'Robot hardware not connected. Challenge will run in simulation mode.'
            }
          </Alert>
        )}

        {/* Challenge Runner */}
        {challengeStarted ? (
          renderChallengeComponent()
        ) : (
          <Paper sx={{ p: 6, textAlign: 'center', bgcolor: 'background.paper' }}>
            <School sx={{ fontSize: 64, color: 'text.secondary', mb: 2 }} />
            <Typography variant="h5" gutterBottom>
              Ready to Start?
            </Typography>
            <Typography variant="body1" color="text.secondary" sx={{ mb: 3 }}>
              This challenge will test your understanding of robotics concepts and give you hands-on experience with robot control.
            </Typography>

            {currentChallenge.is_unlocked ? (
              <Button
                variant="contained"
                size="large"
                startIcon={<PlayArrow />}
                onClick={handleStartChallenge}
              >
                Begin Challenge
              </Button>
            ) : (
              <Alert severity="warning">
                This challenge is locked. Complete previous challenges to unlock it.
              </Alert>
            )}
          </Paper>
        )}
      </Box>
    </Container>
  );
};

export default IndividualChallengePage;
